    - List
    - "Za górami, za lasami żył sobie Bjorn. Pewnego zimnego ranka obudziło go stukanie
      w okno. Po paru chwilach, gdy w końcu udało mu się otworzyć oczy, zobaczył Drozda
      z liścikiem w dziobie. Wystraszył się, że to kolejne pismo od komornika. Po
      otwarciu koperty zobaczył to … \n              „Przyjeżdżam za 6 tygodni, mam
      nadzieje, że przygotujesz dla mnie cos dobrego… - TEŚCIOWA.”"
    - '2016-03-30 17:13:27.085014'
    - '2016-03-30 17:13:27.085014'
  - - 2
    - 1
    - 2
    - Panika
    - Bjorn ze strachu przed swoja teściową zaczął pakować wszystkie potrzebne i niepotrzebne
      rzeczy. Zastanawiał się długo, gdzie mógłby się przed nią schować. W końcu przyleciał
      drozd radząc, by wiał gdzie pieprz rośnie.
    - '2016-03-30 17:13:27.097444'
