    - Syrenka
    - 'Następnego ranka na horyzoncie ujrzeli skałę, a na niej postać kobiety. Wszyscy
      co do jednego chwycili za wiosła i zaczęli gnać w jej stronę. Gdy podpłynęli
      trochę bliżej zobaczyli, że to piękna syrena, kusząca ich swoim głosem. Wikingowie
      nie mogąc oprzeć się tej niewiaście, siedzieli oparci o burtę z jęzorami na
      wierzchu i śliną cieknącą po brodzie. Drozd przyglądał się im z góry dłuższa
      chwilę, po czym rzekł: „Księga Wikingów mówi jasno: Kto się w syrenie zakocha,
      temu morze strzeli focha!”, lecz nikt go nie słuchał, więc odwrócił się do nich
      ogonem i odleciał.'
