    - Wąż Loko
    - 'Po kilku dniach ciągłej walki z wiatrem, jedni zrobili się zieloni na twarzy
      i zaczęli farbować wodę, drudzy nadal trzymali się masztu coraz bardziej trzęsąc
      portkami, a cała reszta z Bjornem na czele dzielnie prowadziła łajbą. Aż tu
      nagle, ni z gruchy ni z pietruchy obok nich wynurzył się dziwny stwór. Długi
      był na 100 metrów, do węża bardzo podobny, ale na łbie miał potężnego irokeza.
      Bjorn spytał go: „Kim jesteś i gdzie znajdę jakiś ląd?”, po czym ten odpowiedział:
      „Loko mówią mi, a ląd wiele mil ssssstąd jesssst”, po czym zanurzył się ochlapując
      wszystkich i odpłynął w nieznane.'
