    - Sztorm
    - 'Po rozmowie z wężem Lokiem na niebie zebrały się czarne chmury. Wtedy już cała
      załoga zaczęła panikować i miała pełne gacie. Jedynie Bjornowi pozostały resztki
      rozumu i krzyknął do załogi: „Czego się bardziej boicie – podmuchu wiaterku,
      czy oddechu teściowej?!” Wtedy wszyscy bez chwili namysłu ruszyli dalej. Wpłynęli
      w wielką burzę, miotało nimi jak szatan na lewo i prawo, aż w końcu fala zepchnęła
      ich na skałę i cała łódź poszła w drzazgi. Bjorn w ostatniej chwili złapał ocalałą
      deskę i próbował dostrzec resztę swojej załogi. Niestety, nikogo nie zobaczył.
      Jedynie w oddali słyszał słowa Drozda „BJORN come back, come back…”'
