    - Kokos?
    - Wygląd wyspy, na której się znaleźli zdziwił ich, ponieważ była ona całkiem
      inna niż te w miejscu ich zamieszkania. Bjorn poczuł, że coś go kłuje w plecy.
      Wyglądało to jak duża, brązowa włochata kulka. Nie wiedział co to jest, ale
      pomyślał, że jak będzie z tym chodzić i do tego czegoś mówić, to w końcu coś
      się wykluje. Na chwilę zapominając o tym, co znalazł, zaczął wzywać pomoc. Po
      kilku godzinach nadal nikt go nie usłyszał, dlatego ze złości wziął swoje „jajo”
      i rzucił nim o palmę. Magiczna kulka rozpadła się, ale uderzenie było tak silne,
      że z palmy spadło kilka nowych. Bjorn podniósł rozbitą kulkę. Pięknie pachniała,
      więc spróbował ją zjeść. Postanowił, że nazwie to kokos i zrozumiał, że dzięki
      nim będzie miał pożywienia na wiele dni.
