    - Złota rybka
    - "Dobrobyt uderzył Bjornowi do głowy i jak już ma ekskluzywny hamak, to przecież
      nie będzie się żywić samymi kokosami. Postanowił więc ponownie udać się do dżungli,
      aby znaleźć coś, z czego mógłby wykonać wędkę. Pełen doświadczenia z poprzedniego
      dnia uwinął się z tym raz dwa . Wrócił na swoją plażę, ale złowić rybę nie było
      wcale tak łatwo. Na początku mu nie szło, ciągle łowił stare deski, buty i staniki.
      Aż w końcu po podniesieniu wędki przeżył szok. Jego oczom ukazała się złota
      rybka. Powiedziała, że może spełnić jego 3 życzenia. Bjorn nie mógł uwierzyć,
      więc odparł: „No to zrób tak, żeby Drozd miał różowy ogon”. Przez chwilę nic
      się nie działo, aż tu bach! Różowe pióra! Bjorn pomyślał, że ja może mieć wszystko
      co chce, to mógłby odzyskać swój toporek. Rybka go wysłuchała, broń spadła z
      nieba i uderzyła go w łeb, tym samym powalając go na ziemię. Drozd pochylił
      się nad nim i szyderczym głosem powiedział : „HA! To za te pióra!”\n              "
