    - Dziadek
    - 'Gdy fascynacja pieprzem minęła, spostrzegli dym, do którego chcieli dojść.
      Znajdował się on na końcu wielkiego pola. Przeszli przez pieprzowe krzaki ciągle
      kichając, aż w końcu dotarli do małej chatki. Zapukali, a z domku wybiegł dziadek,
      który celował do nich z procy nabitej pieprzem. Starzec miał wielkie oczy i
      nos oraz czoło wjeżdżające na potylice (zakola :)). Po krótkiej rozmowie z nim
      dowiedzieli się, że on również uciekał wiele lat temu od swojej teściowej gdzie
      pieprz rośnie. Po kilku godzinach gadania, Bjorn zapytał dziadka z ciekawości,
      dlaczego ma takie wielkie oczy. Ten odparł mu na to, że musi dobrze widzieć
      intruzów na swoim polu. Bjorn z jeszcze większym zainteresowaniem zapytał: „A
      dlaczego masz taki duży nos?” – ten śmiejąc się odparł – „A to przez ciągłe
      kichanie od pieprzu.”'
