    - Zła nowina
    - Cała trójka rozmawiała ze sobą do późnej nocy o wszystkim i niczym. Dziadek
      przypomniał sobie, że w ostatnim czasie na wyspie działo się coś dziwnego. Opowiadał
      im o tym jak wulkan zaczął sobie popierdywać, pogoda zrobiła się kapryśna jak
      baba, a pieprzowe krzaki zaczęły więdnąć. W tym momencie staruszek zaczął trząść
      się ze strachu i rozpoczął opowiadać o tym, jak szedł sobie w nocy do wychodka,
      a tu nagle zobaczył jakąś postać w krzakach, w której okularach odbijał się
      księżyc i przypomniał sobie o wieczorach, kiedy światło lampki odbijało się
      od szkieł teściowej w podobny sposób. Dziadek powiedział, że po tych wydarzeniach
      niebezpiecznie jest chodzić po nocy, więc zaproponował im żeby zostali na kilka
      kolejnych dni.
